        1 to ICON_CORONA,
        2 to ICON_DESAYUNO,
        3 to ICON_RELAX,
        4 to ICON_CAFE,
        5 to ICON_REGALO,
        6 to ICON_PERFUME,
        7 to ICON_COLLAR,
        8 to ICON_SUSHI
