    @Composable
    fun painterForId(id: Int): Painter {
        val base64 = base64ById[id] ?: ICON_REGALO
        return remember(base64) { BitmapPainter(decodeIcon(base64)) }
    }

    private fun decodeIcon(encoded: String): ImageBitmap {
        val bytes = Base64.decode(encoded, Base64.DEFAULT)
        val bitmap = requireNotNull(BitmapFactory.decodeByteArray(bytes, 0, bytes.size)) {
            "No se pudo decodificar el icono"
        }
        return bitmap.asImageBitmap()
    }

